script: |
  super -f text -I q6765.spq | sort > q6765.out

inputs:
  - name: q6765.spq
    data: |
      SELECT - col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col0 / + + col2 BETWEEN ( - 6 * + + 64 ) AND col1 * - ( + col1 );
  - name: tab0

outputs:
  - name: q6765.out
    data: |
      -10
      -47
      -99
